import React, { useState } from 'react';
import { Tab, Container, Nav, Row, Col } from 'react-bootstrap';
import './Admin.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from '../Navbar/Navbar';
import { OrganisationalUnit } from './OrganisationalUnit';
import { Asset } from './Asset';
import { User } from './User';
import Cookies from 'js-cookie';
import jwt_decode from 'jwt-decode';
export const Admin = () => {
  const token = Cookies.get('token');
  const role = token.return(
    <div>
      <Navbar />
      <Container className="admin-container">
        <Tab.Container
          id="left-tabs-example"
          defaultActiveKey="first"
          className="side-nav"
        >
          <Row className="side-nav">
            <Col sm={3}>
              <Nav variant="pills" className="flex-column">
                <Nav.Item>
                  <Nav.Link eventKey="first">Organisational Units</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link eventKey="second">Assets</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link eventKey="third">Users</Nav.Link>
                </Nav.Item>
              </Nav>
            </Col>
            <Col sm={9}>
              <Tab.Content>
                <Tab.Pane eventKey="first">
                  <OrganisationalUnit />
                </Tab.Pane>
                <Tab.Pane eventKey="second">
                  <Asset />
                </Tab.Pane>
                <Tab.Pane eventKey="third">
                  <User />
                </Tab.Pane>
              </Tab.Content>
            </Col>
          </Row>
        </Tab.Container>
      </Container>
    </div>
  );
};
